INSERT INTO `autres_partenariat` (`id`, `nom`, `adresse`, `image`, `comment`, `email`, `ok`) VALUES 
(6, 'Bestiaire', 'http://www2.bestiaire.org', '', 'Incarnez un sorcier et affronterz les autres joueurs.', 'jeu@bestiaire.org', 1),
(7, 'Anathas', 'http://www.anathas.com', 'http://www.anathas.com/images/anathas46068.jpg', 'Gérez votre pays pour devenir riche et influant dans le monde d''Anathas!', '', 1);
INSERT INTO `autres_regles` (`id`, `section`, `valeur`) VALUES 
(1, 'Le Joueur', 'Un joueur, qui apparait sous l&#039;identité d&#039;un héros, doit fournire un certain nombre d&#039;information concernant son identité pour pouvoir s&#039;inscrire. L&#039;adresse mail doit aussi être valable pour envoyé la confirmation d&#039;activation, et en cas de problèmes, pouvoir le contacter. Les joueurs ne respectant pas ces demandes seront supprimé sans préavis.'),
(2, 'Le Joueur', 'L''utilisation de plusieurs compte est stictements interdites.'),
(3, 'Le Joueur', 'Un joueur à le droit de demander à une personne non jouante ou à un autre joueur de s''occuper de son compte pour une durrée maximale de cinq jours, en avertissant les administrateurs avec les éxplications de cet accord.'),
(4, 'Le Joueur', 'Un joueur choisi une race parmit six disponibles. Il commence avec un certain nombre de ressources (or, nourriture, pierre, bois, magie) et un certain nombre de paysans. Ces valeurs peuvent changer d''une version à l''autre.'),
(5, 'Le Joueur', 'Un joueur n''a le droit qu''a un seul compte, et qu''un seul compte par foyer. Si ces règles ne sont pas suivies, les sanctions peuvent varié d''un avertissement, à une suppression des comptes, et même un banissement du site.'),
(6, 'Le Joueur', 'Blood Warriors est un jeu gratuit. Il est interdit de vendre un compte, d''obliger à quelqun de supprimer son compte.'),
(7, 'Le Joueur', 'Tous joueurs à le droit de changer les informations personnels le concernant en envoyant un email aux webmasters.'),
(8, 'Le Héros', 'Le joueur cherche à gagner et à s&#039;amuser. Un joueur doit progresser dans ses points. Il peut y atteindre en construisant des bâtiments, avoir plus de paysans, guerroyer avec les autres joueurs, engager des unités.'),
(9, 'Le Héros', 'Le joueur se trouve placer sur une carte du monde. Il y est placé aléatoirement et ne peut pas changer d&#039;emplacement.'),
(10, 'Les bâtiments', 'Le joueur peut construire un certain nombre de bâtiments. Au début il n&#039;a aucun bâtiment et ne peut construire des bâtiments du niveau “village”. Une fois tous les bâtiments construit du niveau “village”, un bouton, en bas de la page constructions, apparait et lui propose de passer au niveau suppérieur. Certains bâtiments sont dit &quot;unique&quot;, c&#039;est-à-dire que vous n&#039;avez que besoin de les construires une seule fois.'),
(11, 'Les bâtiments', 'Les bâtiments peuvent être endommagés par les attaques ennemies. Si un bâtiment passe en dessous de 20% de sa vie, ils devient innutilisable et vous ne bénéficerez plus de ses bonnus. Mais vous pouvez les réparer à tout moment.'),
(12, 'Les bâtiments', 'Chaque bâtiment à un coups de construction, des points de vie et un temps nessessaire. Les coûts peuvent changer d&#039;une version à l&#039;autre, et même en cours de version si les administrateurs le trouve nessessaire.'),
(13, 'Les Unités', 'En construisant un fort, ou autres bâtiment dit de guerre, vous aurez la possibilité d&#039;engager un certain nombre d&#039;unité. Ces unités servent à attaquer et à défendre votre province. Les unités peuvent mourrir en guerre, ou à cause de sortilège.'),
(14, 'Les Unités', 'En construisant d&#039;autre bâtiments, plus d&#039;unités vous seront accessible. Chaque race possède aussi un nombre unique d&#039;unités disponibles uniquement à elle.'),
(15, 'Les Unités', 'Les unités possèdent 4 caractéristiques. La première est la force, la deuxième l&#039;endurance, la troisième l&#039;attaque et la quatrième la defense. Chaque unité à des caractéristiques différentes, mais ces caractéristiques sont définies par les administrateurs. Celles-ci peuvent changer entre les saisons, et au cours d&#039;une saison si les administrateurs le semble nécessaire.'),
(16, 'Les Unités', 'Les noms des unités est définit par les administrateurs. Leurs coûts ne demandent que de l&#039;or, de la nourriture et de la magie.'),
(17, 'Les Unités', 'Quand une unité est en cour d&#039;attaque sur une province ennemie, celle-ci ne peut pas defendre votre province. Elle sera à nouveau disponible que lorsqu&#039;elle revient.'),
(18, 'Les Unités', 'Lorsque de combat, si une de vos créatures meurent, l&#039;ennemi gagne de l&#039;or. Cela va de même pour vous.'),
(19, 'Les Guerres', 'Un héros (attaquant) peut choisir à n&#039;importe quel moment, s&#039;il possède un fort et des unités, d&#039;attaquer un autre héros (défenseur).'),
(20, 'Les Guerres', 'Chaque joueur choisi une technique de guerre. Celle-ci détermine des bonnus à octroyer aux joueurs.'),
(21, 'Les Guerres', 'Les untisé prennent un certain temps pour arriver dans les provinces ennemies, et le même temps pour revenir.'),
(22, 'Les Guerres', 'Quand le défenseur n&#039;a plus d&#039;unités pour défendre, les unités attaquantes attaquent les défenses de la province. Lorsque celle-ci sont passées, l&#039;attaquant vole un certain pourcentage de ressources. Si le pourcentage complet prévu n&#039;est pas atteind, les unités attaquantent attaquent et tues les paysans et les bâtiments.'),
(23, 'La Magie', 'Il existe plusieurs utilités pour la magie autre que l&#039;engagement d&#039;unité et la construction.'),
(24, 'La Magie', 'Les sortilèges.\r\nIl existe plusieurs type de sortilège. Ceux qui ont un effet immédiat, d&#039;autres qui ont un effet à durée variables.'),
(25, 'La Magie', 'Les runnes\r\nLes runnes de garde ne sont disponible que une fois par version. Mais encore cette valeur peut changer d&#039;une version à l&#039;autre.\r\n/!\\Pas encore développé.'),
(26, 'Les Alliances', 'Chaque joueur peut descider de créer une alliance.'),
(27, 'Les Alliances', 'Une alliance ne peux posséder plus de 15% (arrondi au supérieur) des joueurs inscrits.'),
(28, 'Les Alliances', 'Un joueur ne peux créer ou rejoindre une alliance que s&#039;il a une auberge. '),
(29, 'Forum & Shootbox', 'Le forum est divisé en Sections, qui possèdent des Topiques contenus de Contributions.'),
(30, 'Forum & Shootbox', 'On y écrit en français. Le langague SMS n&#039;est pas toléré. Les petites fautes d&#039;inatention oui, mais à condition que ce n&#039;est pas trop fréquant.\r\nD&#039;autre part, aucune discution à caractère sexuelle, nazi, maltraitance des annimaux, pédophilie, ou autre sujet jûgé &quot;inapte&quot; au jeu ne sont tolérés.'),
(31, 'Forum & Shootbox', 'Les administrateurs peuvent, s&#039;ils le jugent nécessaire, retirer le droit de contribution au Forum et à la Shootbox aux utilisateurs.'),
(32, 'Forum & Shootbox', 'Évidemment, on ne troll pas, et les K3vin c&#039;est à la porte.'),
(33, 'Sanctions', 'Si un joueur ne réspecte pas les règles, ils sera sanctionné. Une crois rouge apparaitera alors à côté de son pseudo, avec la raison de cela en titre de l&#039;image.\r\nSi un joueur accumule 3 sanctions, il sera privé de jeux une semaine.\r\nAu bout du 4ème, celui-ci sera définitivement supprimé et banni.'),
(34, 'Bons comportements', 'Les joueurs faisant preuvent de bon comportement, qui apportent du soutient à la communauté, ou aide dans n&#039;importe quelle manière, seront décompenser d&#039;une &quot;Étoile&quot;.');
