INSERT INTO `faq_questions` (`id`, `id_rubrique`, `question`, `reponse`, `date`, `motscles`) VALUES 
(7, 1, 'Qu&#039;est-ce qu&#039;une alliance?', 'Une alliance est un regroupement de joueur. Une alliance possède un dirigeant.', 1168942168, ''),
(3, 2, 'fdg! !!', 'fdhgfgh', 1168871833, ''),
(8, 1, 'Comment créer une alliance?', 'Il faut construire le bâtiment [Auberge][Village], et payer une certaine somme (qui peut changer d&#039;une partie à l&#039;autre), ou être Rebelle.', 1168942208, ''),
(9, 5, 'PNA', 'PNA: Pacte de Non-agression.\r\n\r\nDes alliances décrétant une PNA ont pour parole de ne pas s&#039;attaquer jusqu&#039;à ce que le PNA soit rompu.', 1168942535, 'PNA'),
(10, 5, 'Village', 'Le Village est le premier état de votre province. les bâtiments y sont petit et faible.', 1168942583, 'village'),
(11, 5, 'Ville', 'La ville est le deuxième état de votre province, évolution du Village.', 1168942611, 'Ville'),
(12, 5, 'Cité', 'La cité est le troisième état de votre province, évolution de la Ville.', 1168942649, 'Cité'),
(13, 1, 'À quoi servent les alliances?', 'Les alliances servent à regrouper plusieurs joueurs sous un point en commun. Soiffe de victoire, prospérité et paix, camarades dans la vrai vie, etc... Tous les pretextes sont bons pour monter une alliance!', 1168942723, 'Alliance'),
(14, 1, 'Comment quitter une alliance?', 'Si vous n&#039;êtes pas d&#039;un grade suppérieur de l&#039;alliance, il faut aller sous &quot;Nouvelles de l&#039;alliance&quot;, et tout en bas se trouver un bouton &quot;Quitter cette alliance!&quot;.', 1168942795, 'quitter alliance'),
(15, 1, 'Comment rejoindre une alliance?', 'Pour rejoindre une alliance, il faut avoir contrtuit le bâtiment [Auberge][Village] pour accéder au menu des Alliances. Vous trouverez un menu de recherche qui vous indique les noms des alliances et la possibiliter de voir leur description et d&#039;en rejoindre une.', 1168942889, 'rejoindre alliance'),
(16, 1, 'Comment supprimer mon alliance?', 'Pour supprimé une alliance, vous devez être le chef de celle-ci. Sous le paneau d&#039;administration, tout en bas se trouver un lien &quot;Dissoudre cette alliance&quot;. Ne vous inquiétez pas, une confirmation est demandée, ayant eut trop de problèmes dans le passé... (Ils se reconnaîtront)', 1168942963, 'supprimer, détruire, alliance'),
(17, 1, 'Comment changer de chef d&#039;alliance?', 'Pour changer le chef d&#039;alliance, il faut en être le chef, et aller sous le paneau d&#039;administration de l&#039;alliance. Sous celle-ci, en dessous des textes, vous trouverez une liste des membres avec la possibilité de changer leur niveau.\r\n\r\nMettez le nouveau chef à 5, et valider. Il deviendra chef et vous Sous-chef.', 1168943192, 'chef alliance'),
(18, 1, 'À quoi correspondent les niveaux des membres?', 'C&#039;est très simple:\r\n1: Membre, il peut lire les news interne, et participer au forum.\r\n2: Sous-chef, celui-ci peut faire les choses du membre, plus modifier les news et valider des membres.\r\n3: Chef, même chose que le sous-chef, sauf qu&#039;il peut en élire un nouveau et détruire l&#039;alliance.', 1168943268, 'niveaux alliances'),
(19, 6, 'Comment s&#039;inscrire?', 'Pour s&#039;inscrire, il faut aller sous le liens &quot;S&#039;inscrire&quot; dans la barre en haut. Vous serez ammené au formulaire d&#039;inscription où il faut remplire les champs.', 1168943610, ''),
(20, 6, 'L&#039;administration voit-elle mon mot de passe?', 'Évidemment que non. Tous les mots de passes sont cryptés dans la base de données avec une algorythme qui n&#039;a pas d&#039;inverse. En d&#039;autre therme il est impossible pour nous s&#039;avoir votre mot de passe.\r\n\r\nDe plus, seul les administrateurs suprêment peuvent voir ce mot de passe cryptés, car ils sont les seuls à avoir accès à la base de donnée.', 1168943776, 'mot de passe'),
(21, 6, 'Quelle race choisir?', 'Voir la section [Races]', 1168943808, ''),
(22, 6, 'Il me dit que mon pseudo est déjà pris?!', 'C&#039;est que quelqun d&#039;autre utilise déjà ce pseudo. Il faut dans ce cas en choisir un autre.', 1168943859, ''),
(23, 6, 'À combien de comptes ai-je droit?', 'Vous n&#039;avez le droit qu&#039;a UN SEUL ET UNIQUE compte par personne. Nous filtrons les accès à l&#039;hébergeur pour vérifier journalièrement cela.\r\n\r\nCependant, si vous êtes plusieurs par foyé à jouer au jeu, si vous indiquez pas le même nom de famille, le nouveau compte sera supprimé.', 1168943959, ''),
(24, 6, 'On se connecte depuis le lycée/travail, comment éviter la suppression?', 'Si vous êtes plusieurs joueurs à vous connecter depuis un lieu de travail ou d&#039;étude, veuillez envoyer un message privé à l&#039;administration.\r\n\r\nSi aucun avertissement n&#039;est donné de votre part, sanction il y aura!\r\n\r\n(Nous envoyons généralement un message privé au cas où vous seriez plusieurs utilisateurs d&#039;un même établissement sans le savoir, histoire d&#039;être sur.)', 1168944084, ''),
(25, 6, 'Combien de temps après l&#039;inscrption puis-je jouer?', 'En règles général, vous pouvez vous connecter directement. Cependant, il se peut que dans le futur, les comptes doivent passer par une validation des administrateurs, suivant quoi celle-ci peut prendre jusqu&#039;à 24h. Une fois qu&#039;un administrateur aura vérifié votre compte, vous recevrez un email de confirmation.\r\n\r\nAttention, certain client envoyent nos mails au SPAM (Courrier indésirable), donc pensez à vérifier.\r\n\r\nSi vous n&#039;avez toujours rien reçu au bout de 24heures, envoyé un mail à l&#039;administration, ou postez sur le forum en donnant les informations nécessaire.', 1168944291, ''),
(26, 7, 'Comment supprimer mon compte?', 'Pour supprimer votre compte, il faut envoyer un message privé à un administrateur qui le fera.', 1168944340, ''),
(27, 7, 'Comment modifier mon mot de passe?', 'Sous la page Paramètres, remplissez le formulaire adéquat.', 1168944374, ''),
(28, 7, 'Comment changer mon pseudo?', 'Vous ne pouvez pas changer de pseudo. Cependant, si vraiment il y a un problème avec votre pseudo, vous pouvez faire une demande à un administrateur (avec un pot de vin biensure!)', 1184596771, 'pseudo, compte'),
(29, 7, 'Puis-je donner mon compte?', 'Si vous donnez votre compte, sachez que vous pouvez le donner, mais en aucun cas vous ne pouvez le VENDRE!\r\n\r\nContactez l&#039;administration avec les nouvelles coordonnées (nom, prénom, mail) et elle s&#039;occupera de la paprasse administrative. (Ne vous inquiétez pas, c&#039;est pas aussi compliquer que d&#039;adopter un enfant! <img src="smiles/icon_smile.gif">)', 1168944473, ''),
(30, 7, 'Je pars en vacances, comment éviter de me faire attaquer?', 'Pour les cas comme ça, un mode &quot;Vacances&quot; à été mis au point.\r\n\r\nSous [Paramètres], en bas vous trouvez un petit formulaire. Attention, vous ne pouvez plus vous connecter avant la fin de la date définie. Aucune nouvelle guerre ou sorts ne pourront être lancés contre vos province, mais vos guerres en cours se finiront.', 1168944570, ''),
(31, 8, 'Qu&#039;est-ce qu&#039;une Race?', 'Dans Blood Warriors, vous avez la possibilité de représenter une des 6 races disponnibles.', 1177317788, 'races'),
(32, 8, 'Anges', 'Les Anges ont un bonnus de +4 en endurance. Ils possèdent ainsi une défense très élevée.\r\n\r\nDe plus, leur taux de maternité est de 2, pas 1 (En placant deux paysans aux Foyers, ils auront 2 paysans aux maternelles, au lieu des 1).\r\n\r\nDe plus, le temps des sorts en réserves sont 1.5 fois plus longs.', 1184597120, 'anges, races'),
(33, 8, 'Barbares', 'Les Barbares possèdent une limite de population augmentée de 20%.\r\n\r\nLeurs tentes peuvent acceuillir deux fois plus d&#039;unités que celles des autres races, et ils endomagent la moitié plus de dégâts aux bâtiments lors de guerres.', 1177318048, 'barbares, races'),
(34, 8, 'Démons', 'Les Démons possèdent une force incroyable, c&#039;est-à-dire un bonnus de Force de +4.\r\n\r\nDe plus, ils peuvent avoir une guerre de plus lorsqu&#039;ils attaquent, et peuvent attaquer des joueurs ayant jusqu&#039;a 0.7 fois leurs puissances.', 1177318131, 'démons, races'),
(35, 8, 'Elfes', 'Les bâtiments coûtent 10% de moins en pierre et en bois chez les Elfes que chez les autres races.\r\n\r\nDe plus, ils peuvent directement construire une deuxième province, et leur temps de guerre est rallentit.', 1177318197, 'elfes, races'),
(36, 8, 'Rebelles', 'Les rebellents récoltent 2 fois plus d&#039;or lorsqu&#039;ils tuent une unités durant une guerre.\r\n\r\nDe plus, tous leurs travaux sont raccourcis d&#039;une heure.\r\n\r\nIls n&#039;ont pas de 3ème bonnus, mais sont dotés d&#039;un bonus +1+1+1+0 sur leurs unités.', 1184596996, 'rebelles, races'),
(37, 8, 'Sorciers', 'Chaque nuit, les sorciers gagnent automatiquement 10% de leur magie en plus.\r\n\r\nDe plus, ils ont accès à certains sorts des le début, et peuvent disposer de la moitié de plus de protections que les autres races.', 1177318330, 'sorciers, races'),
(38, 5, 'Métropole', 'La Métropole est le quatrième et dernier état de votre province, évolution de la Cité. C&#039;est le niveau maximum en terme d&#039;expension en bâtiment.', 1184596725, 'métropole');
