(2, 'Problèmes', 'Vous avez constatez des messages d''erreurs? Des problèmes d''orthographe où même des liens morts? On a besoin de le savoir!', 1, 20, 0, 0, 0),
(3, 'Rôleplay', 'Vennez ajouter du piment au jeu en jouant votre personnage avec coeur!', 2, 30, 0, 0, 0),
(4, 'Aides', 'Les règles paraissent floues? Vous ne comprennez pas le but de faire telle ou telle chose? Les joueurs, les modérateurs et les admins sont là pour vous guider!', 2, 40, 0, 0, 0),
(6, 'Poubelle du délire', 'Mare des topics sérieux? Envie de vous lâcher? C''est ici! (À consomer avec modération!)', 1, 60, 21, 1, 71),
(7, 'Améliorations', 'Vous avez une idée d''amélioration? Grande, petite, complétement farfelue ou réalisable? On vous écoute!', 2, 50, 0, 0, 0),
