(1, 'École', 'ecole', 1, 1, 'Grâce à l&#039;école, vos paysans peuvent s&#039;instuire. Avec leurs nouvelles connaissances, ça leurs prendra 2 heures en moins pour accomplir une tâches dans les champs, les mines, etc... ainsi que les bâtiments!', 5, 15, 10, 5, 15, 10, 30, 2, 28, 45, 0, 'O'),
(2, 'Murailles', 'murailles', 1, 2, 'Les murailles vous permettent de développer des defenses en bois autour de votre province! De quoi dérouter vos ennemis en ce début de développement.', 0, 5, 15, 5, 20, 5, 5, 2, 30, 30, 0, 'O'),
(3, 'Fort', 'fort', 1, 3, 'Le fort vous ouvre les portes au recrutement d''unités. Grâce à cela, vous pourrez attaquer les contrées de vos adversaires et défendre la votre.', 10, 20, 10, 5, 15, 15, 42, 4, 55, 60, 0, 'O'),
(4, 'Marché', 'marche', 1, 4, 'La place du marché vous permet d''échanger vos matières premières avec vos alliés. Cela peut vous servir lors de pot-de-vin, ou de menace lors de guerres.', 5, 10, 10, 10, 20, 15, 22, 2, 25, 50, 0, 'O'),
(5, 'Hotel de Ville', 'hoteldeville', 2, 1, 'L&#039;hotel de ville propose un lieu de repos pour les voyageur, mais il augmente aussi votre limite de population de 150 paysans! Avec ce grand nombre supplémentair de paysans, vos ressources augmenteront nettement plus rapidement.', 27, 16, 29, 18, 47, 30, 45, 6, 50, 120, 0, 'O'),
(6, 'Collège', 'college', 2, 2, 'Le collègue propose un niveau suppérieur d''éducation pour vos paysans. Ils apprendront de nouvelles techniques de rendements des ressources pour travailer jusqu''a 2 heures en moins pour une tâche qui est maintenant simplifiée.', 35, 17, 23, 20, 43, 25, 24, 4, 45, 120, 0, 'O'),
(7, 'Taverne', 'taverne', 2, 3, 'La Taverne est une forme évoluée de l''auberge. Plus de voyageurs y viennent, vos paysans peuvent récolter plus d''informations. Grâce à la taverne, vous aurez le listing de 50% des unités les plus faibles de vos adversaires à disposition!', 35, 35, 20, 20, 40, 55, 37, 4, 52, 165, 0, 'O'),
(8, 'Sorcelerie', 'sorcelerie', 2, 4, 'Sorcelerie, grande école pour les sorciers. Grâce à ce bâtiments, vous pourrez lancer des sortilègues sur vos adversaires!', 20, 23, 35, 17, 52, 70, 32, 5, 64, 145, 0, 'O'),
(9, 'Église', 'eglise', 2, 5, 'L&#039;église enseigne la voie de dieu au croyant, instaurant le christianisme dans votre ville. L&#039;arrive de cette croyance augmente votre territoire et la limite de votre population avec. Vous aurez le droit à votre limite augmentée de 75 paysans!', 20, 15, 10, 15, 25, 20, 14, 2, 35, 80, 0, 'O'),
(10, 'Sanctuaire', 'sanctuaire', 1, 5, 'Le sanctuaire apporte un soutient fondamental à la réalisation des prières pour produire de la magie. La production de magie sera augmentée de 10% une fois ce bâtiment construit.', 5, 5, 0, 10, 10, 5, 7, 1, 25, 25, 0, 'O'),
(11, 'Mine', 'mine', 1, 6, 'La mine apporte des percées technologique permettant d''améliorer la production du travail de l''or. Les récoltes des mines seront augmentées de 10% avec ce bâtiment construit.', 0, 5, 10, 5, 15, 5, 4, 1, 25, 30, 0, 'O'),
(12, 'Municipale', 'municipale', 1, 10, 'La municipale permet un meilleur ogranisation de vos paysans. Avec ces nouvelles directives, votre village pourra accueillire 45 paysans supplémentaires.', 10, 15, 10, 5, 15, 10, 15, 2, 35, 50, 18, 'O'),
(13, 'Palais', 'palais', 3, 1, 'Le Palais est une grande construction dans le village. Il demande beaucoups de temps et de ressources, mais augmente votre limite de population de 225 paysans!', 50, 30, 210, 70, 280, 120, 60, 6, 87, 480, 0, 'O'),
(14, 'Université', 'universite', 3, 2, 'L''unversité vous ouvre la porte à plusieurs nouveaux sorts! Vos ennemis trembleront face à ces nouveautés magiques!', 40, 30, 70, 70, 140, 30, 20, 3, 94, 240, 0, 'O'),
(15, 'Chateau Fort', 'chateaufort', 3, 3, 'Le chateau fort augmente la puissance de defense de votre village dans l''ordre de grandeur de 150points. De quoi vous rendre casiment impénétrable!', 70, 50, 100, 35, 135, 35, 38, 3, 150, 290, 0, 'O'),
(16, 'Place du Marché', 'placedumarche', 3, 4, 'La place du marché évolue le petit marché, et vous permet d''échanger des paysans! De quoi aider les nouveaux arrivants et vos autres provinces!', 40, 60, 45, 30, 75, 65, 17, 2, 78, 230, 0, 'N'),
(17, 'Centre Diplomatique', 'centrediplomatique', 3, 5, 'Le Centre Diplomatique permet de, lors d''une recherche sur un Héros, voir tout les bâtiments qu''il a construit. Cela permet de savoir où il en est, et de préparer une stratégie plus approfondie!', 120, 40, 50, 25, 75, 45, 54, 4, 118, 280, 0, 'N'),
(18, 'Foyer', 'foyer', 1, 7, 'Les foyers construits dans votre village permet d&#039;augmenter la population. La construction des foyers permet d&#039;augmenter votre seuil de population de 20 paysans. Vous ne pouvez construire le foyer que une fois.', 5, 10, 5, 5, 10, 5, 13, 1, 20, 30, 0, 'O'),
(19, 'Foyer', 'foyer', 2, 6, 'Les foyers construits dans votre ville permetent d''augmenter la limite de population. Celle-ci sera augmentée de 20 paysans avec l''arrivée du foyer.', 5, 12, 7, 10, 17, 10, 9, 2, 28, 44, 0, 'O'),
(20, 'Temple', 'temple', 4, 1, 'Le temple est un bâtiment symbolique qui permet de réunir vos paysans, et de les rendres plus heureux. Ainsi, votre limite de population est augmentée de 310!', 50, 200, 300, 60, 360, 200, 56, 6, 210, 810, 0, 'O'),
(21, 'Arène', 'arene', 4, 2, 'L''Arène vous permet d''engagé la meilleur unité du jeu. Cette unité est un légendaire Dragon! Son souffle est capable de détruire des continants entier, et ne laisser que désolation derrière eux.', 400, 60, 150, 80, 230, 530, 53, 5, 210, 1220, 26, 'O'),
(22, 'Bibliothèque', 'bibliotheque', 4, 3, 'Bibliothèque, reperts de nombreux livres de toutes sortes. De nombreuses sciences y sont ressensées! Grâces à cela, les connaissances des sorts les plus puissants sont à vous!', 55, 45, 65, 30, 95, 200, 28, 3, 170, 395, 0, 'O'),
(23, 'Chateau', 'chateau', 4, 4, 'Le château est la preuve de votre grande souverèneté. Sa splendeur est à l''image de votre province, glorieuse et puissante.', 1100, 500, 1625, 890, 2515, 720, 82, 7, 15000, 5600, 0, 'O'),
(24, 'Tour d''Observation', 'tourdobservation', 4, 5, 'La Tour d''Observation permet d''espionner sur les provinces ennemies, voyant ainsi les sorts en réserve de celle-ci!', 40, 30, 50, 120, 170, 55, 30, 1, 90, 295, 0, 'O'),
(25, 'Centre de Recrutement', 'centrerecturement', 2, 7, 'Le centre de Recrutement ouvre toute une nouvelle dimension d''unités de combat à engager! Avec ces nouvelles troupes, vous deviendrez encore plus puissant, et plus redoutable.', 20, 5, 15, 10, 25, 15, 37, 3, 70, 65, 0, 'O'),
(26, 'Garnison', 'garnison', 4, 7, 'La Garnisson vous permettera d''engager les meilleurs unités disponibles! Permettant de ravager des villages entiers, mais attendez-vous à ce que les unités soient chères!', 120, 45, 30, 60, 90, 80, 31, 2, 130, 335, 0, 'O'),
(27, 'Auberge', 'auberge', 1, 8, 'Point de rassemblement le soir pour les paysans, l''auberge leurs proposent de jouer aux cartes, discuter, et boire plein de bière! L''auberge est aussi nécessaire pour rejoindre et créer une alliance.', 5, 10, 15, 10, 25, 20, 20, 3, 40, 60, 0, 'N'),
(28, 'Forge', 'forgerie', 1, 9, 'Une fois le fort constuit, qu''un petit nombre d''unité vous est proposé. La construction de la Forgerie vous ouvre la porte à de nouvelles unités qui sont spécifiques pour votre Race.', 20, 5, 25, 15, 40, 25, 30, 3, 50, 90, 3, 'O'),
(29, 'Grandes Murailles', 'gmurailles', 2, 8, 'Avec l''évolution de votre village en ville, les murailles en bois sont devenues obsolètes face à des attaques ennemis toujours plus fortes. Les Grandes Murailles vous permettent de développer des murailles en Pierre, bien plus robustes que celles en bois!', 25, 30, 60, 20, 80, 30, 27, 5, 60, 165, 0, 'O'),
(30, 'Caserne', 'caserne', 3, 6, 'La caserne apporte du nouveau soutient pour vos unités, permettant d''en engager des plus fortes et plus redoutables que jamais!', 49, 35, 78, 74, 152, 66, 40, 3, 98, 302, 0, 'O'),
(31, 'Quartier Stratégique', 'quartierstrategique', 2, 9, 'De nouvelles stratégies peuvent être mises en place grâce à la construction de ce bâtiment. Elles vous permettent de coordonner jusqu''à deux attaques simultanées sur deux provinces différentes!', 12, 18, 23, 16, 39, 18, 19, 3, 55, 87, 0, 'N'),
(32, 'Ferme', 'ferme', 1, 11, 'La ferme permet d''aménager les cases non-utilisable en cases utilisables. Une fois la ferme construite, vous verrez apparaitre un lien "Terrain" dans la naviguation.', 5, 5, 20, 10, 30, 8, 17, 4, 30, 48, 0, 'O'),
(33, 'Guilde de repérage', 'guildedereperage', 1, 12, 'Construire la Guilde de repérage vous permet, lors d''une recherche sur une province, voir les ressources que celle-ci dispose.', 15, 10, 15, 12, 27, 11, 19, 2, 42, 63, 0, 'O'),
(34, 'Crêche pour Enfants', 'crechepourenfants', 2, 10, 'La Crêche pour Enfants vous permet d''étendre votre royaume. Sous l''onglet "Province" vous sera accessible, une fois ce bâtiment construit, la possiblité pour une certaine somme, de coloniser de nouvelles provinces.', 20, 10, 18, 22, 40, 30, 31, 4, 68, 100, 0, 'N'),
(35, 'Maçonnerie', 'maconnerie', 2, 11, 'Votre province est pleine de champs, de forêt, ou de zone rocheuse. La maçonnerie, malgré son nom, prend en charge ce type de terrain. Sous l''onglet "Terrain", vous trouverez la possiblité d''acheter des cases.', 10, 15, 12, 30, 42, 13, 22, 2, 57, 80, 0, 'O'),
(36, 'Cathédrale', 'cathedrale', 3, 7, 'Ce bâtiment permet d''augmenter la limite de sort de "protection" en réserve à 20.', 23, 17, 96, 24, 120, 100, 47, 5, 114, 256, 0, 'O'),
(37, 'Entrepot', 'entrepot', 2, 12, 'L''entrepot vous permet de stocker vos ressources, et donc d''ettandre votre limite de 200, allant ainsi de 350 à 550 par ressource.', 14, 27, 54, 26, 80, 52, 14, 3, 83, 173, 0, 'O'),
(38, 'Tour de Mana', 'tourdemana', 3, 8, 'La Tour de Mana vous permet de stocker jusqu''à 2000 fioles de Magie! Ainsi, vous pourrez terrasser vos ennemis en les innodants de sortilèges magiques.', 75, 55, 260, 70, 330, 250, 31, 2, 200, 455, 0, 'O'),
(39, 'Carrière', 'carriere', 2, 13, 'Une nouvelle carrière est découverte avec ce bâtiment, permettant d''extraire 15% de plus de Pierre lorsque vos paysans y travaillent!', 20, 5, 15, 20, 35, 20, 6, 1, 50, 80, 0, 'O'),
(40, 'Grand Entrepôt', 'grandentrepot', 4, 8, 'Avec la grandeur que prend votre province, et les bâtiments toujours plus puissant, la production de vos paysans ne peut plus suivre! Le Grand Entrepôt permet d''élevé la limite de 1000!', 130, 300, 450, 380, 830, 260, 21, 4, 400, 1560, 0, 'O'),
(41, 'Muraille Enchantée', 'murailleenchantee', 4, 9, 'Muraille de Granit', 40, 20, 300, 100, 400, 95, 31, 3, 210, 555, 0, 'O'),
(42, 'Centre des Affaires Étrangères', 'centredesaffairesetrangeres', 4, 10, 'Le CdAE permet d''avoir le listing complet des unités quand on fait une recherche sur une province. (Et l''affichage est amélioré).', 50, 45, 60, 60, 120, 70, 20, 3, 110, 285, 0, 'O');
