INSERT INTO `liste_sorts` (`id`, `nom`, `description`, `cout`, `batint`, `pourcentage`, `variable`, `cible`, `titre_choix`, `temps`, `race`) VALUES 
(1, 'Charme', 'Permet de voler deux paysans de la province d''un héros ennemis.', 20, 8, 0.05, '2', 1, 'Choisissez une province à charmer', 0, '0'),
(2, 'Vol', 'Permet de piller des ressources de la province d''un héros ennemis.', 20, 0, 0.01, '5', 1, 'Choisissez une province à dérober', 0, '0'),
(3, 'Main Forte', 'Diminue de 6heures la construction d''un de vos bâtiments en cours de construction.', 75, 0, 0.05, '6', 0, '', 0, '0'),
(4, 'Protection', 'Protège contre le prochain sortilège lancé contre vous, vos unités ou vos provinces.', 20, 0, 0.2, '0', 10, '', 0, '0'),
(5, 'Carapace', 'Augmente la defense de votre province durant les prochaines 10 heures', 40, 8, 0, '20', 3, '', 20, '0'),
(6, 'Epidémie', 'Provoque une épidémie sur une province du joueur adverse', 200, 14, 0, '10', 0, '', 0, '0'),
(7, 'Boule de mana entropique', 'Inflige 4 domages à une unité choisie aléatoirement', 7, 14, 0, '4', 0, '', 0, '0'),
(8, 'Voile Magique', 'Fait disparaître cette province de la carte, de la liste de province a attaquer, et de la recherche sur vous pendant un certain temps.', 250, 99, 0, '8', 0, '', 0, '0'),
(9, 'Esprit du guerrier', 'Transforme un de vos paysans disponnible en unité de guerre 1/2/1/-1', 25, 8, 0, '1', 0, 'Transformez un paysans en une unité 1/2/1/-1', 0, '0'),
(10, 'Vol+', 'Une version évoluée du Vol permettant de voler jusqu''à 15 ressources.', 30, 14, 0, '15', 0, '', 0, '0'),
(11, 'Charme+', 'Une version évoluée du Charme', 30, 14, 0, '5', 0, '', 0, '0'),
(12, 'Gain Magique', 'Fait apparaître aléatoirement des ressources', 5, 8, 0, '3', 0, 'Faire apparaître des ressources', 0, '0'),
(13, 'Fuite de Magie', 'La fuite de magie réduit de 10% les réserves de magie de la province ennemie.', 300, 8, 0, '10', 1, 'Choisissez une province a "faire fuire"', 0, '0'),
(14, 'Grande Pourriture', 'La Grande Pourriture divise les rations de nourriture par 4 de la province ciblée.', 420, 14, 0, '4', 1, 'Choisissez une province à pourrire', 0, '0'),
(15, 'Ailes de la victoire', 'Vos guerres durent 2 fois moins longtemps pour les prochaines 20 heures', 50, 14, 0, '0.5', 30, '', 20, '0'),
(16, 'Marteau D''Acier', 'Le Marteau d''Acier augmente l''attaque de 2 point sur vos unités pour les prochaines 20 heures.', 40, 8, 20, '2', 1, '', 20, '0'),
(17, 'Fécondité Artificielle', 'Pour un coups de magie, fait apparaitre un paysans supplémentaire', 10, 8, 0, '1', 0, 'Faire apparaître des ressources', 0, '0'),
(18, 'Nouveau souffle', 'Le Nouveau Souffle répart tous vos bâtiments endormagés!', 1800, 22, 0, '0', 0, 'Donnez un nouveau souffle à mes bâtiments!', 0, '0'),
(19, 'Grand Bouclier', 'Le Grand Bouclier est un bouclier magique qui entoure votre province, comme la carapace.', 300, 22, 0, '200', 0, '', 20, '0'),
(20, 'Tremblement', 'Inflige des dégâts aux Plaques d''une province ennemie.', 500, 22, 0, '100', 0, 'Réduire ces Plaques en cendre! Détruit jusqu''à 100 plaques de chaque type', 0, '0'),
(21, 'Saint-aura', 'Redonne 10% de satisfaction à une de votre province', 1150, 22, 0, '10', 0, 'Redonne 10% de satisfaction à une de votre province', 0, '0'),
(22, 'Rage Controlée', 'Une rage controlée donne +2+0+0+0 à toutes vos unités pour 24 heures!', 600, 14, 0, '2', 1, 'Donne +2+0+0+0 aux unités', 20, '0'),
(23, 'Bénédiction', 'Bénit vos unités en leurs donnant +2+2+0+0 pour 20 heures!', 400, 22, 0, '+2+2+0+0', 5, 'Bénit vos unités en leurs donnant +2+2+0+0 pour 20 heures!', 20, '0'),
(24, 'Annulation', 'Supprime tous les sortillèges en réserve de la province ciblée.', 1050, 14, 0, '0', 0, 'Retirez-moi ces sortilèges!', 0, '6'),
(25, 'Force', 'Donne +0-1+2+0 aux unités d''une province de votre choix.', 95, 14, 0, '+0-1+2+0', 5, 'Donnez +0-1+2+0 aux unités de cette province!', 20, '6'),
(26, 'Resistance', 'Donne -1+0+0+2 aux unités d''une province ciblée', 95, 14, 0, '-1+0+0+2', 5, '', 20, '6'),
(27, 'Croissance de force', 'Augmente de 1 la force des unités d''une de vos provinces ou celle d''un allié pendant 10 heures', 30, 8, 0, '1', 1, '', 10, '6'),
(28, 'Croissance de résistance', 'Augmente de 1 la résistance des unités d''une de vos provinces ou celle d''un allié pendant 10 heures', 30, 8, 0, '1', 3, '', 10, '6'),
(29, 'Croissance de vitesse', 'Augmente la vitesse des unités d''une de vos provinces ou celle d''un allié pendant 10 heures', 45, 8, 0, '0.9', 30, '', 10, '6'),
(30, 'Chant Angélique', 'Donne +0+1+0+1 aux unités d''une province alliée pendant 1 heure.', 150, 8, 0, '+0+1+0+1', 5, '', 1, '1'),
(31, 'Cri Angélique', 'Donne +0-1+0-1 à une province ennemie pendant 1 heure.', 150, 8, 0, '+0-1+0-1', 5, '', 1, '1'),
(32, 'Chant du Désordre', 'Les unités de la province ciblée font 2 fois plus de dégâts aux bâtiments pendant 1 heure.', 150, 8, 0, '2', 31, '', 1, '2'),
(33, 'Cri du Désordre', 'Les unités de la province ciblée font 2 fois moins de dégâts aux bâtiments pendant 1 heure.', 150, 8, 0, '0.5', 31, '', 1, '2'),
(34, 'Chant Démoniaque', 'Donne +0+0+2+0 aux unités d''une province alliée pendant 1 heure.', 150, 8, 0, '+0+0+2+0', 5, '', 1, '3'),
(35, 'Cri Démoniaque', 'Donne +0+0-2+0 aux unités d''une province ennemie pendant 1 heure.', 150, 8, 0, '+0+0-2+0', 5, '', 1, '3'),
(36, 'Chant Elfique', 'Pendant 1 heure, l''engagement d''unités d''une province alliée coutent la moitié en nourriture.', 150, 8, 0, '0.75', 11, '', 1, '4'),
(37, 'Cri Elfique', 'Pendant 1 heure, l''engagement d''unités d''une province ennemie coutent le double en nourriture.', 150, 8, 0, '1.25', 11, '', 1, '4'),
(38, 'Chant de Rassemblement', 'Pendant 1 heure, le temps de guerre et d''envoit durent 20% en moins.', 150, 8, 0, '0.8', 30, '', 1, '5'),
