INSERT INTO `messages` (`id_message`, `id_from`, `id_to`, `titre`, `message`, `time`, `nouveau`, `location`, `expiration`) VALUES 
(257, 1, 0, 'Nouveautés', 'Premièrement, bienvenue à cette nouvelle saision de Blood Warriors!\r\n\r\nPlusieurs nouveautés ont été apportées au jeu. Des grandes et des petites. Commencons par le plus interessant.\r\n\r\n<strong>Bâtiments</strong>:\r\nDorénavant, les bâtiments possèdent une vie. Quand vous construisez un bâtiment, sa jauge est pleine. Mais lors d&#039;une guerre, les unités qui cassent les défense des murailles et baricade s&#039;en prennent ensuite aux bâtiments et les endormages. Quand un bâtiments est à 0, il est inutilisable (ben oui, perdre son fort de devoir passer 60heures a le reconstruire c&#039;est pas glop) Mais il faut au moins 20% de la jauge d&#039;un bâtiment pour l&#039;utiliser. Dès qu&#039;un bâtiment n&#039;est plus à son max, vous pouvez assigner des paysans pour le réparer.\r\n\r\n<strong>Unités</strong>:\r\nIl faut à présent investir dans des tentes avant d&#039;engager des unités. Une tente peut contenir 5 unités, et on peut avoir 20 tentes pour une case. Soit 200 unités par cases.\r\n\r\n<strong>Sorts</strong>:\r\nLes sorts ont été revus. Le sort charme notemment, il n&#039;est plus possible de dépasser de plus de 10% sa pop max en volant des paysans aux provinces ennemies. Aussi, chaque sort possède une image personnalisée pour rendre les images plus jolies et amusantes. (Fini les supers images hors sujet...)\r\n\r\nAussi, de nouveaux sorts sont disponnibles.\r\n\r\n<strong>Annonces</strong>:\r\nCette nouvelle page, visible même pas loggé, remplace les textes affiches en bas du message de saison sous [Nouvelles]. La différence entre cette partie est le forum est que sur le forum on link au message ici, et on discute sur le forum, et le forum permet aussi à d&#039;autres joueurs que les admins de faire des annonces diverses.\r\n\r\n<strong>Guerres</strong>:\r\nD&#039;une part les vie des bâtiments ont été créé, qui permet de ne plus voir le scénario &quot;j&#039;ai beaucoups d&#039;unités mais je met pas sacrifice et je perd juste 25points par défaite et quelques ressources, car mainenant on démolit des bâtiments. Il faut donc prévoire des ressources pour réparer les bâtiments endommagés/détruits. Aussi, le system de sacrifice à été revu. D&#039;orénavant, lorsque qu&#039;une unités attaque, il y a 4 possibilité.\r\n1) Le defenseur a une unité plus forte qui tue et résiste a l&#039;attaquante\r\n2) Le defenseur a une unités qui ne tue pas l&#039;ennemi mais survit.\r\n\r\nJusqu&#039;a présent, le script ne cherchait que ces cas de firugres parmis les unités qui ont le sacrifice, mais ca a été changé. Il faut voir en cela la mentalité d&#039;une unité: &quot;<em>Oh, un noob. je vais aller lui casser la gueule pour suaver mon village même si on m&#039;a pas demandé de le faire</em>&quot;.\r\nLe sacrifice entre en compte quand une unités attaquante ne trouve pas de rival de taille, et le defenseur désigne &quot;toi, t&#039;es unitle, va le stopper en mourrant, plutôt qu&#039;il endomage ma province directement&quot;.\r\n\r\nEnsuite, si une unités offensive ne se fait pas bloquer, elle attaque d&#039;abord les bâtiments defensifes (Barricade, Murailles, Chateau Fort, etc...), et une fois tous ses batiments détruit, elle s&#039;attaque a un bâtiment au hasard parmis ceux que le defenseur controle. Ainsi, les unités ne se concentrent pas sur un seul bâtiment, mais un pillage général.\r\n\r\n<strong>Corrections générales</strong>:\r\nÉvidemment, des bugs ressancés lors des saisons précédantes ont été corrigés, et avec l&#039;arrivée de nouveautés, de nouveaux bugs doivent se cacher. Comme à chaque fois (<em>Sic!</em>), j&#039;ai tenté de tester tous les cas de figure pour tout, mais il risque de rester des bugs. Par contre mon orthographe est toujours aussi mal, désolé <img src="smiles/icon_wink.gif">\r\n\r\n\r\n\r\nSur ce, je vous souhaite une bonne saison!', 1152899798, 0, 'ann', 0),
(258, 1, 0, 'A venir', 'Comme à chaque saison, il a des nouveautés pas encore complétement implantées, ou pas encore terminées.\r\n\r\nC&#039;est le cas pour plusieurs choses:\r\n\r\nLe niveau 3 n&#039;est pas encore complétement (voir totalement?) terminé. Cela viendra avec le temps. Mais il devrait être disponnible au courant de la saison.\r\n\r\nIl y a certains sorts qui sont semi développés. Ces sorts ne sont pas encore integrés. \r\n\r\nVoili voilà. J&#039;oublie certainement pleins de choses, mais ça viendra <img src="smiles/icon_D.gif">', 1152900112, 0, 'ann', 0),
(272, 1, 0, 'Avancement', 'Hellow!\r\n\r\nPeu de mise à jour récemment, veuillez m&#039;en excuser. Je suis en phase de terminer les nouveautés, et la recherche d&#039;un nouvel hébergeur est bienôt terminée! (ça va me couter, mais on sera tranquil).\r\n\r\nPremièrement, voici le tableau d&#039;avancement:\r\n/*------------------------------------\r\n+ <strong>Avancement Général</strong>\r\n+ Graphisme: 90%\r\n+ Conquête: 10%\r\n+ Gestion unité: 90%\r\n+ MAJ + NEW sorts: 70% \r\n+ Correction Bugs: 90%\r\n+ Métropole: 30%\r\n+ Scores: 100%\r\n+ Modif paramètres couts: 60%\r\n+ Automatique: 100%\r\n+ Optimisation ScriptGuerre: 50%\r\n+ Nouveautés: 40%\r\n+ Total: 80%\r\n+------------------------------------*/\r\n\r\nJe suis surtout en train de développer les nouveautés, dont une qui va mettre des sourirs aux visages! (Non, pas un correcteur orthographique <img src="smiles/icon_wink.gif">)\r\n\r\nCependant, un grand frein va stopper pratiquement net les avancements avant Juillet, car j&#039;ai mes examens de diplômes qui commencent dans 3 semaines! Mais dés Juillet, je serai employé (développeur web héhé, qui l&#039;aurait cru? <img src="smiles/icon_wink.gif">), et donc plus d&#039;étude, et donc le temps de développer BW plus souvent et pouvoir tenir une partie! (Et payer l&#039;hébergeur... mouarf).\r\n\r\nÀ bientôt!\r\n\r\n~ <em>Escape</em>, Webmaster', 1178046656, 0, 'ann', 0),
(270, 1, 0, 'Et de une!', 'Voilà une semaine que le jeu est lancé!\r\n\r\n31 inscriptions, dont 1 est mon compte, et un autre le compte &quot;test&quot;, soit 29 inscriptions réel, j&#039;avoue que avec le peu de pub que j&#039;ai fait, je suis satisfait (Merci ARRG au passage pour le message sur anathas <img src="smiles/icon_wink.gif">)\r\n\r\nAlors, un bilan a dresser? En tout cas, il y a eut pas mal de bug qui ont plus ou moins perturbé le début de saison, mais pas de manière drastiques, car vraisemblablement tout est rentré dans l&#039;ordre. Le pire reste à venir: Les guerres et les sorts. Mais je suis confiant que l&#039;on sera surmenter les problèmes <img src="smiles/icon_wink.gif">\r\n\r\nEt sinon, j&#039;aimerai dire merci aux joueurs, pour leur aide au développement du jeu, à leur bonne humeur, car c&#039;est chiant les jeux qui bugs! Et merci de jouer <img src="smiles/icon_wink.gif">\r\n\r\nCette saison durera une durée indéterminée. Au max jusqu&#039;à Noël je pense, enfin on verra. Le but de ces beta est surtout d&#039;améliorer l&#039;équilibre du jeu, et ainsi rentre le tout plus stable, proposer un meilleur amusement pour les joueurs.\r\n\r\nLe côté RP du jeu n&#039;a pas encore commencer, mais j&#039;ose espérer que ça viendra gentillement. Les guerres et les alliances aideront pas mal j&#039;espère.\r\n\r\nBref! J&#039;ai plus grand chose à dire, à part encore et toujours Merci!\r\n\r\n<em>Réagire à cette article? C&#039;est ici: <a href="http://bw.decemberescape.com/index.php?p=topic2&id=28" target="_Blank">http://bw.decemberescape.com/index.php?p=topic2&id=28</a> </em>', 1159216572, 0, 'ann', 0),
(271, 1, 0, 'Et après un mois...', 'Le cape du premier mois est passé!\r\n\r\nEncore merci aux joueurs, qui amènent de l&#039;amusement au jeu!\r\n\r\nCependant, ce premier mois n&#039;a pas été que joie et bonheur. Plusieurs problèmes, notemment en début de saison avec les paysans qui buggaient, sont venus perturber le jeu.\r\n\r\nÀ cela s&#039;ajoute un truc hélas bien dommage. Je parle ici de doubles comptes. Aujourd&#039;hui, j&#039;ai à nouveau sanctionné 2 joueurs, (pour un total de 5 comptes). Cela monte à 5 ces cas. Ce problème n&#039;est pas facile pour moi d&#039;intercepter, puisque je ne controle plus les inscriptions. Mais pour l&#039;instant je les laisses ouvertes comme elles le sont, en espérant que les joueurs auront l&#039;honnêté de suivre les règles sans que je doive verifier derrière.\r\n\r\nBref. Le jeu va bientôt prendre une nouvelle direction, avec plusieurs joueurs qui arrivent à la fin du niveau [Cité]. Des guerres ont déjà éclatées, et c&#039;est maintenant qu&#039;il va falloir faire preuve d&#039;alliances et de stratégies! J&#039;espère que les guerres se dérouleront mieux que les précédantes versions.\r\n\r\nEn parlant de guerre, un nouveau rapport de gerre a été monté. Rien de glorieux, mais il est bien plus facile de comprendre le résultat des unités que l&#039;ancien mode avec jute du texte.\r\n\r\nMais (et oui, il y a toujours un mais), un problème plus qu&#039;embettant sévit actuellement, c&#039;est celui de l&#039;hébergeur. Vous êtes plusieurs à venir vous plaindre vers moi pour le manque de stabilité de celui, et j&#039;en suis consient.\r\n\r\nSeulement voilà, cet hébergement m&#039;a coûté 13€ pour un ans. C&#039;est provisoir. Dès que je lancerai une version définitive et stable du jeu, je prendrai un hébergeur correcte. Donc je vous prie de garder patience <img src="smiles/icon_smile.gif">\r\n\r\nEn tout cas, même si le jeu est pas très actife, je remercie tous ceux qui participent au forum! Certain d&#039;entre vous font même de la pub autour d&#039;eux, et on m&#039;a demandé de rédiger un text pour présenter BW. Je vais le faire, et il sera disponnible bientôt (une fois de plus, j&#039;aurai besoin de votre aide pour l&#039;orthographe <img src="smiles/icon_wink.gif">).\r\n\r\nAller, bon jeu à vous tous!', 1161198645, 0, 'ann', 0),
(273, 1, 0, 'Nouveau Serveur', 'Voilà, vu que le contrat avec OVH arrivait à terme, j&#039;ai commandé chez Informaniak.ch, réputé pour la qualité de leurs serveurs et le service.\r\n\r\nPour l&#039;instant j&#039;ai 10mois gratuit, et ensuite j&#039;aurai un forfait de 90€ par ans (plus des la 2ème année).\r\n\r\nCependant, l&#039;hébergement passe de 60Mo à 50giga, avec 16 BDD pour séparer BW et le reste de l&#039;hébergement, faire des backups, un service de connexion fiable qui ne lâche pas de 17 à 22heure.\r\n\r\nPlus tard, je mettrai en place un système de don et alopass pour financer le serveur.\r\n\r\nBref, sinon le développement arrive bientôt à terme. J&#039;espère finir avant mes examens (ils commencent le 31 mai et finissent le 22 juin wargh!). J&#039;ai mis en place cette nouvelle version déjà en ligne pour le design, et pas transférer le tout du vieux car les bases de données ont subit un bouleversement majeur.\r\n\r\nAlors à tout bientôt j&#039;espère!', 1178046905, 0, 'ann', 0),
(274, 1, 0, 'Avancement Bis', 'Voilà, 1 mois que je n&#039;ai pas touché le code, car je suis en période d&#039;examen! Mais dès juillet, j&#039;aurai fini pour de bons les études, et pourrait me dévouer pleinement à BW! (Bon, j&#039;ai mon groupe de musique qui prend de plus en plus de place dans ma vie avec les concerts et tout... donc je vais essayer de trouver le juste millieu <img src="smiles/icon_wink.gif">)', 1180285977, 0, 'ann', 0),
(275, 1, 0, 'Septembre?!', 'Petite mise à jour, j&#039;ai réussit mon CFC d&#039;informaticien, j&#039;ai commancé le boulot et j&#039;ai repris le coddage de BW.\r\n\r\nCa avance bien, je dois encore ajouter peu de choses. Voici le tableau d&#039;avancement:\r\n\r\n+ Avancement Général\r\n+ Graphisme: 100%\r\n+ Conquête: 100%\r\n+ Gestion unité: 100%\r\n+ MAJ + NEW sorts: 70-&gt;90% <strong>Edit 17.07</strong>\r\n+ Correction Bugs: 90%\r\n+ Métropole: 55-&gt;100% <strong>Edit 17.07</strong>\r\n+ Scores: 100%\r\n+ Modif paramètres couts: 80-&gt;90% <strong>Edit 17.07</strong>\r\n+ Automatique: 100%\r\n+ Optimisation Scripts: 80-&gt;85% <strong>Edit 17.07</strong>\r\n+ Nouveautés: 70-&gt;90% <strong>Edit 17.07</strong>\r\n<strong>+ Total: 95%</strong>\r\n\r\nJe vais essayé de finir la Métropole d&#039;ici la fin de la semaine, et commencer les nouveaux sorts la semaine prochaine. Après suivera des petites nouveautés pas forcément très visible, et plus d&#039;amélioration.\r\n\r\nJe vais essayé de faire tourner une version pour début septembre, pendant 2mois en version accélérée, puis lancé la version finale.\r\n\r\nÀ bientôt!\r\n\r\n~ <em>Escape</em>', 1184137711, 0, 'ann', 0),
(276, 1, 0, 'Blood Warriors V 4.0.0', 'Après plus de 3ans de développement, je vous présente...\r\n\r\n<strong>BLOOD WARRIORS V4.0.0</strong>, ou la première version <ins>STABLE</ins>!\r\n\r\nPour ça, comme annoncé dans une news précédente, un hébergeur pro à été prit (qui coute 90€ par ans). Cette fois, toutes les fonctionnalités qui ont été prévue depuis le début du développement sont en place! Et évidemment, il y a eut pas mal de changement depuis la version précédente.\r\n\r\n<strong>Premièrement</strong>, quelque chose de majeur, la conquête de province! On peut toujours avoir 3 provinces, et à part la province de début, toutes les autres peuvent être conquerrient. Ainsi, on aura un % de satisfaction de la province vis-à-vis du Héros qui la contrôle. À chaque défaite, la province perds de la satisfaction, et vise-versa, à chaque victoire, en regagne. Par défaut, la satisfaction est à 80%. Elle peut monter jusqu&#039;à 150%. Si une province passe en dessous de 15%, le Héros qui à fait passer ce seuil prend possession de la province, avec un taux de 30%. Les bâtiments, paysans, unités, et ressources restent comme elles l&#039;étaient après la guerre.\r\n\r\nUn héros ne peut cependant posséder plus de 10 provinces.\r\n\r\nEn plus, les alliances ont d&#039;avantages plus d&#039;importances dans cette nouvelle version. On peut maintenant envoyer des unités à d&#039;autres provinces que l&#039;on possède, ainsi qu&#039;aux provinces des membres de notre alliance! Le temps pour déplacer une unité est pareil que pour une guerre. \r\n\r\nAttention cependant, vous ne pouvez pas envoyer plus d&#039;unités que de capacité de tente de la province cible!\r\n\r\n<strong>Deuxièmement</strong>, le design a été revu. Fini le jeu de gris et de rouge, place à quelque chose de plus vivant, plus chaud! Il reste quelques problèmes d&#039;affichage sous Internet Explorer 6. Je n&#039;ai pas testé le 7. Et tant pis pour vous si ça ne fonctionne pas. Utilisez Firefox (fonctionne avec 1.5 et 2.0).\r\n\r\nEnsuite, les coûts des bâtiments ont été revu, ainsi que certains bonus. On peut avoir jusqu&#039;à environ 900 paysans en mode métropole à présent (700 avant).  \r\n\r\nDe plus, les &quot;plaques&quot; ont fait leurs apparitions. Plutôt que le château fort, barricade, murailles et cie, on gérè directement les défenses de notre province avec celles-ci. Cela rend, en plus, plus utile le bois et la pierre.\r\n\r\nLes bonus de race ont été revus évidemment. Trop d&#039;inégalité avant (celui des rebelles était... inutile [celui de l&#039;auberge]). Celui des anges (temps de carapace deux fois plus long) était aussi inutile, c&#039;est pour ça que l&#039;effet s&#039;étend sur plusieurs sors à présent.\r\n\r\nDe nombreux bugs ont été corrigés, notamment celui du marché (possibilité d&#039;avoir infini de paysans et ressources). Des messages d&#039;erreurs ont été revu pour les rendre plus explicites. \r\n\r\nCertains sorts ont été revu (et tous ont été reprogrammés). Le sort de Boule De Mana Entropique existe toujours, mais inflige à présent que 4 dégâts (les bonus races/sorts sont pris en compte). On ne verra plus toutes les unités décimées en l&#039;espace de 30 minutes (surtout avec le bug du marché corrigé). Les ressources max ont été revues à la hausse légère (inflation quand tu nous tiens). Bien entendu, de nouveaux sorts font leur apparition (qui risquent d&#039;en amuser plus d&#039;un). \r\n\r\nLe niveau Métropole de la province est enfin développé, avec les effets des bonus liés aux bâtiments en question.\r\n\r\nMis à part ça, pleins de petites modifications ont été ajoutée, mais ne sont pas forcément pleinement visibles. Voici une petite liste vite faite:\r\nDans le forum, on a plus tous les topiques qui passent en lu quand on en visite un du thème. Une page BUGS pour soumettre un bogue ainsi que voir le suivit (et verifier que je bosse vraiment [imagebw]smiles/icon_wink.gif[/imagebw]). Nouvelle gestion des droits, je peux interdire certains d&#039;utiliser le forum et la shootbox à présent &gt;[imagebw]smiles/icon_smile.gif[/imagebw]. Nouvelle FAQ et RÈGLES. Possibiliter que des joueurs modifient la FAQ. Automatisation: script qui tourne régulièrement et calcule les retours des paysans, réparations des bâtiments, etc...\r\n\r\nEt un <ins>correcteur orthographique</ins>! Non je rigole. Vous auriez aimé hein? [imagebw]smiles/icon_D.gif[/imagebw]\r\n\r\nBref, que du bonheur! Alors bon jeu, et que la force de Blood Warriors soit en vous!', 1188303308, 0, 'ann', 0),
