(295, 7, 0, '', 'Les elfes sont trop faibles T_T', 1188651180, 0, 'bug', 1),
(296, 10, 0, '', 'Pour 0 or, vous avez fait terraformer 10 cases inexploitables en cases exploitables.', 1188652108, 0, 'bug', 2),
(297, 10, 0, '', 'Config que la maconnerie prenne 0 cases', 1188652407, 0, 'bug', 1),
(298, 10, 0, '', 'Pouvoir acheter plusieurs tentes à la fois', 1188652450, 0, 'bug', 2),
(299, 10, 0, '', 'Dans le &lt;title&gt; jeu de rôle FRANCOPHONE pas francais xD', 1188653046, 0, 'bug', 2),
(349, 1, 0, '', 'Regrouper bois et pierre en matériaux', 1188727208, 0, 'bug', 2),
(328, 0, 0, '', 'L&#039;équipe de Blood Warriors te souhaite la bienvenu sur le site! Si t&#039;es nouveau, empresse toi de lire les règles et la FAQ! Si tu as des questions, n&#039;hésite pas à demander sur le forum et l&#039;équipe ainsi que les joueurs se feront un plaisir de te répondre!\r\n\r\nN&#039;oublie pas aussi de dire le bonjour sur le forum <img src="smiles/icon_bave.png">\r\n\r\nPetite aide du début: cbcbvcbConcentre toi sur ton nombre de paysans! Mets les dans les Foyers. Attention aussi à prévoire une attaque soudaine d&#039;autres joueurs peu scrupuleux. Cet univers sanglant est sans merci pour les nouveaux!', 0, 0, 'acc', 0),
(333, 10, 0, '', 'Vous n&#039;avez plus de places libres pour engager des unités! Achetez d&#039;abord des tentes sous [Gérer vos unités]!\r\n\r\nLe Formattage est totalement rien à voir xD', 1188666613, 0, 'bug', 2),
(334, 10, 0, '', 'Followup: dans le &lt;title&gt; tu as mis &quot;fracophone&quot; xD', 1188666662, 0, 'bug', 2),
(341, 10, 0, '', 'Page guerre: lorsque tu lances une guerre et que c&#039;est la dernière à laquelle tu as le droit ca affiche &quot;Vous avez déjà votre nombre maximal de guerre en cours!&quot; comme si la guerre avait pas été lancée.', 1188667967, 0, 'bug', 1),
(342, 10, 0, '', 'Enlever le message aléatoire de tout en haut, et en tout cas ne pas le mettre en bold. En plus le &lt;hr&gt; ca fait pas joli', 1188668004, 0, 'bug', 2),
(507, 999999991, 1, '', 'Monseigneur, nous avons reçu les ordres!<br /><br /> Nous préparons nos rations et notre équipement, et partons tout de suite!<br /><br />Nous avons confiance en notre coisade contre la province <strong>&#40657;&#22283;</strong> du Héro VieuxChat! Ils n''en verront que du feu, car nos 4 unités se battent pour une raison qu''elles considèrent juste: La votre!<br /><br />Nous arriverons à destination le 03-09-2007 à 12:09:32!', 1188814172, 2, 'mes', 1189073372),
(508, 999999991, 9, '', 'Monseigneur,<br /><br />Nous avons reçu de source sûre une information comme quoi l''armée de la province <strong>Escaping Reality</strong> du Héros Escape attaquent notre province &#40657;&#22283;!<br /><br />D''après nos prévisions, elles arriveront au seuil de notre province le 03-09-2007 à 12:09:32!<br /><br />Afin de mieux les combattres, nous avons besoin de vos instructions! Donnez-nous les ordres de défense sous la gestion des guerres, et nous protégerons votre province avec tous nos moyens possibles!', 1188814172, 0, 'mes', 1189073372),
(509, 999999991, 9, '', 'Le Héros Escape à rappelé ses troupes de son attaque sur votre province &#40657;&#22283;!', 1188814276, 0, 'mes', 1189073476),
(510, 999999996, 11, '', 'Monseigneur,<br /><br />Nous avons reçu une réponse positive de la part de l''alliance toto!<br />', 1188897568, 0, 'mes', 1189156768),
(511, 999999996, 7, '', 'Monseigneur,<br /><br />Nous avons reçu une réponse positive de la part de l''alliance toto!<br />', 1188898096, 0, 'mes', 1189157296),
(512, 999999991, 1, '', 'Monseigneur, nous avons reçu les ordres!<br /><br /> Nous préparons nos rations et notre équipement, et partons tout de suite!<br /><br />Nous avons confiance en notre coisade contre la province <strong>&#40657;&#22283;</strong> du Héro VieuxChat! Ils n''en verront que du feu, car nos 4708 unités se battent pour une raison qu''elles considèrent juste: La votre!<br /><br />Nous arriverons à destination le 05-09-2007 à 13:39:48!', 1188907008, 2, 'mes', 1189166208),
(513, 999999991, 9, '', 'Monseigneur,<br /><br />Nous avons reçu de source sûre une information comme quoi l''armée de la province <strong>GanGrande</strong> du Héros Escape attaquent notre province &#40657;&#22283;!<br /><br />D''après nos prévisions, elles arriveront au seuil de notre province le 05-09-2007 à 13:39:48!<br /><br />Afin de mieux les combattres, nous avons besoin de vos instructions! Donnez-nous les ordres de défense sous la gestion des guerres, et nous protégerons votre province avec tous nos moyens possibles!', 1188907008, 0, 'mes', 1189166208),
(514, 999999992, 1, '', 'Voici le résultat de la guerre de Escape:GanGrande qui attaquait VieuxChat:&#40657;&#22283;. \n \nL''attaquant Escape a attaqué avec un total de 4708 unités. Sa puissance totale s''est élevée à 91111 \n \nLe defenseur VieuxChat s''est défendu avec 725 unités. Sa puissance totale s''est élevée à 50904 \n Voici le rapport détailé: \n En tout, l''attaquant a perdu 645 unités, et en a tué 1. Les unités de l''attaquant ont causé pour 45620 dégâts aux bâtiments et aux murailles de la province du défenseur. De plus, 3983 des unités attaquantes ont effectué un pillage général. \n La guerre c''est terminée avec la victoire de l''attaquant Escape. \nIl vole en tout 5305 d''Or, 3983 de Nourriture, 22231 matériaux. \nEn plus, le defenseur perd 222 paysans. \n  \n De plus, l''attaquant a gagné 2 Or pour les unités qu''il a tué, et le defenseur en gagne 1290. \n', 1188907118, 2, 'mes', 1189166318),
(515, 999999992, 9, '', 'Voici le résultat de la guerre de Escape:GanGrande qui attaquait VieuxChat:&#40657;&#22283;. \n \nL''attaquant Escape a attaqué avec un total de 4708 unités. Sa puissance totale s''est élevée à 91111 \n \nLe defenseur VieuxChat s''est défendu avec 725 unités. Sa puissance totale s''est élevée à 50904 \n Voici le rapport détailé: \n En tout, l''attaquant a perdu 645 unités, et en a tué 1. Les unités de l''attaquant ont causé pour 45620 dégâts aux bâtiments et aux murailles de la province du défenseur. De plus, 3983 des unités attaquantes ont effectué un pillage général. \n La guerre c''est terminée avec la victoire de l''attaquant Escape. \nIl vole en tout 5305 d''Or, 3983 de Nourriture, 22231 matériaux. \nEn plus, le defenseur perd 222 paysans. \n  \n De plus, l''attaquant a gagné 2 Or pour les unités qu''il a tué, et le defenseur en gagne 1290. \n', 1188907118, 0, 'mes', 1189166318),
